css:
.keybinding-resolver {
  -webkit-flex: 0.25;
  overflow: scroll;
}
.keybinding-resolver .keystroke {
  margin-right: 1em;
}
.keybinding-resolver table .matched .command:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f03a";
}
.keybinding-resolver table .unmatched .command:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f081";
}
.keybinding-resolver table .command,
.keybinding-resolver table .selector,
.keybinding-resolver table .source {
  min-width: 10em;
}
.keybinding-resolver table .source {
  cursor: pointer;
}
